export default function () {
    group('Get dividend', () => {
        const netuid = Math.round(Math.random() * 20)
        const hotkey = hotkeys[netuid][Math.floor(Math.random() * hotkeys[netuid].length)]
        const url = `http://localhost:8000/api/v1/tao_dividends?netuid=${netuid}&hotkey=${hotkey}`

        const headers = {
            'Accept': 'application/json',
            'Authorization': `Bearer k6-load-test`
        };

        const response = http.get(
            url,
            {
                headers: headers,
                timeout: '300s',
            }
        );

        check(response, {
            "get dividend": res => res.status === 200 || res.status === 503,
        });

        if (response.status === 200) {
            check(response, {
                "get dividend - OK": res => res.status === 200,
            });
        }

        if (response.status === 503) {
            check(response, {
                "get dividend - Service not available": res => res.status === 503,
            });
        }
    })
}
